(window.webpackJsonp=window.webpackJsonp||[]).push([[23],{46:function(p){p.exports={chapterTitle:null,title:"\u7b2c23\u7ae0 \u5bb6\u65cf\u4f01\u4e1a\u7684\u95ee\u9898",content:"<article><h2>\u7b2c23\u7ae0 \u5bb6\u65cf\u4f01\u4e1a\u7684\u95ee\u9898</h2><p>\u3000\u3000\u5f20\u606a\u5750\u674e\u4e49\u6c5f\u7684\u8f66\u8d76\u5230\u7701\u59d4\u7701\u653f\u5e9c\u9ad8\u7ea7\u5b98\u5458\u5c45\u4f4f\u7684\u65b0\u6d77\u82d1\uff0c\u8d76\u4e0a\u8c22\u665a\u6674\u7684\u8f66\u4e5f\u8fdb\u5927\u95e8\u3002</p><p>\u3000\u3000\u66ff\u8c22\u665a\u60c5\u5f00\u8f66\u7684\u662f\u540d\u804c\u4e1a\u88c5\u626e\u7684\u5973\u4eba\uff0c\u4e09\u5341\u56db\u4e94\u5c81\uff0c\u77ed\u8896\u6761\u7eb9\u886c\u886b\uff0c\u6d0b\u7070\u5957\u88d9\uff0c\u767d\u51c0\u7684\u8138\u4e0a\u6234\u7740\u91d1\u8fb9\u773c\u955c\uff0c\u7ed9\u4eba\u5e72\u51c0\u5229\u843d\u7684\u611f\u89c9\u3002</p><p>\u3000\u3000\u4e24\u90e8\u8f66\u505c\u5728\u9662\u5b50\u91cc\uff0c\u5f20\u606a\u7ad9\u5728\u53f0\u9636\u4e0a\uff0c\u770b\u7740\u8c22\u665a\u6674\u8d70\u8fc7\u6765\u3002</p><p>\u3000\u3000\u6ca1\u6709\u6700\u521d\u89c1\u7684\u7ea2\u6da6\u5ae9\u817b\uff0c\u8138\u6108\u53d1\u663e\u5f97\u96ea\u767d\uff0c\u6ca1\u6709\u4e00\u4e1d\u6742\u8d28\uff0c\u773c\u795e\u5f88\u75b2\u60eb\uff0c\u8c22\u665a\u6674\u770b\u89c1\u5f20\u606a\uff0c\u7ef7\u7d27\u7684\u795e\u7ecf\u4f3c\u4e4e\u8f7b\u677e\u4e86\u4e9b\uff1a\u201c\u5c0f\u606a\u4e5f\u6765\u4e86\u3002\u201d</p><p>\u3000\u3000\u201c\u82b7\u5f64\u4e0d\u80af\u5403\u996d\uff0c\u8fc7\u6765\u966a\u966a\u5979\u3002\u201d</p><p>\u3000\u3000\u5f90\u5b66\u5e73\u7684\u7231\u4eba\u5468\u53d4\u60e0\u8d70\u51fa\u6765\uff0c\u677e\u4e86\u53e3\u6c14\u4f3c\u7684\u8bf4\uff1a\u201c\u4f60\u4eec\u90fd\u8d76\u56de\u6765\u5c31\u597d\uff0c\u5c0f\u59d1\u5976\u5976\u53d1\u813e\u6c14\uff0c\u6211\u90fd\u5feb\u6025\u6b7b\u4e86\u3002\u4f60\u4eec\u996d\u8fd8\u6ca1\u6765\u5f97\u5403\u5427\uff1f\u201d\u770b\u89c1\u8c22\u665a\u6674\u540e\u9762\u7684\u5973\u4eba\uff0c\u201c\u7eef\u5a1f\u9001\u665a\u6674\u6765\u7684\uff0c\u90a3\u7559\u4e0b\u6765\u5403\u996d\u518d\u8d70\u3002\u201d</p><p>\u3000\u3000\u201c\u6211\u6015\u4e0b\u5348\u7ed9\u82b7\u5f64\u7f20\u4f4f\u8131\u4e0d\u4e86\u8eab\uff0c\u5c31\u628a\u8521\u59d0\u53eb\u8fc7\u6765\u4e00\u8d77\u8ba8\u8bba\u516c\u53f8\u7684\u4e8b\u60c5\u3002\u201d\u8c22\u665a\u6674\u5728\u4e00\u65c1\u89e3\u91ca\u9053\u3002</p><p>\u3000\u3000\u201c\u5fd7\u660e\u7559\u4e0b\u6765\u7684\u70c2\u644a\u5b50\uff0c\u4f60\u8981\u89c9\u5f97\u8f9b\u82e6\uff0c\u5c31\u628a\u80a1\u4efd\u64a4\u51fa\u6765\uff0c\u628a\u82b7\u5f64\u5e26\u597d\u5c31\u884c\u2026\u2026\u201d</p><p>\u3000\u3000\u201c\u5fd7\u660e\u653e\u5fc3\u5c06\u516c\u53f8\u4ea4\u7ed9\u4e09\u54e5\u4ed6\u4eec\uff0c\u7ed3\u679c\u8fd9\u51e0\u5e74\u6765\u516c\u53f8\u7ba1\u7406\u4e00\u56e2\u7cdf\uff0c\u5fd7\u660e\u8fd9\u6b21\u5e26\u6211\u8ddf\u82b7\u5f64\u53bb\u6d77\u5dde\uff0c\u6253\u7b97\u770b\u770b\u4e0b\u9762\u7684\u95ee\u9898\u5230\u5e95\u662f\u51fa\u5728\u54ea\u91cc\uff0c\u54ea\u60f3\u5230\u2026\u2026\u201d\u8c22\u665a\u6674\u54ac\u7740\u5634\u5507\u8bf4\u4e0d\u4e0b\u53bb\uff0c\u7ea2\u7740\u773c\u775b\uff0c\u773c\u6cea\u5728\u773c\u7736\u91cc\u6253\u8f6c\u3002</p><p>\u3000\u3000\u5468\u53d4\u60e0\u53f9\u4e86\u4e00\u53e3\u6c14\uff1a\u201c\u8fd9\u4e5f\u6028\u4e0d\u4e0a\u4f60\u4e09\u54e5\u4ed6\u4eec\uff0c\u8c01\u60f3\u5230\u4f1a\u53d1\u751f\u8fd9\u6837\u7684\u4e8b\u60c5\uff1f\u201d</p><p>\u3000\u3000\u8c22\u665a\u6674\u62bf\u7740\u5634\u4e0d\u8bf4\u8bdd\uff0c\u5468\u6dd1\u60e0\u8f7b\u53f9\u4e86\u4e00\u58f0\uff0c\u77e5\u9053\u529d\u4e0d\u542c\uff0c\u4fa7\u7740\u8eab\u5b50\u8ba9\u5927\u5bb6\u8fdb\u5c4b\u53bb\u3002</p><p>\u3000\u3000\u5f20\u606a\u542c\u4ed6\u4eec\u597d\u50cf\u5728\u8bf4\u5bb6\u65cf\u4f01\u4e1a\u7684\u4e8b\u60c5\uff0c\u5fc3\u91cc\u5947\u602a\uff0c\u5f90\u5fd7\u660e\u662f\u7701\u653f\u6cd5\u59d4\u4e66\u8bb0\u7684\u513f\u5b50\uff0c\u600e\u4e48\u8fd8\u5728\u7701\u5185\u7ecf\u5546\uff1f\u5f90\u5b66\u5e73\u770b\u4e0a\u53bb\u4e0d\u50cf\u8086\u65e0\u5fcc\u60ee\u7684\u9886\u5bfc\uff0c\u4ed6\u9000\u4e0b\u53bb\u4e4b\u540e\uff0c\u6c11\u95f4\u4e5f\u6ca1\u6709\u4e0d\u5229\u4ed6\u7684\u4f20\u95fb\uff0c\u771f\u662f\u5947\u602a\u4e86\uff0c\u8981\u77e5\u9053\u4e2d\u592e\u65e9\u5728\u516b\u4e94\u5e74\u5c31\u6709\u5e72\u90e8\u5b50\u5973\u56de\u907f\u7ecf\u5546\u7684\u89c4\u5b9a\u3002</p><p>\u3000\u3000\u5f20\u606a\u8d70\u8fdb\u5c4b\u5b50\uff0c\u770b\u89c1\u82b7\u5f64\u8d64\u7740\u811a\u6b63\u4e0b\u697c\u68af\uff0c\u8e29\u5230\u5730\u677f\u4e0a\uff0c\u6709\u4e9b\u72b9\u8c6b\u7684\u7ad9\u5728\u90a3\u91cc\uff0c\u773c\u775b\u4e00\u7728\u4e0d\u7728\u7684\u76ef\u7740\u81ea\u5df1\uff0c\u4eff\u4f5b\u53d7\u4e86\u60ca\u5413\u7684\u5c0f\u517d\uff0c\u4e0d\u6562\u52a8\u5f39\u3002</p><p>\u3000\u3000\u5f20\u606a\u8e72\u4e0b\u6765\uff0c\u770b\u7740\u82b7\u5f64\u8ba9\u4eba\u60ca\u60b8\u7684\u773c\u775b\uff0c\u8bf4\u9053\uff1a\u201c\u82b7\u5f64\u4e0d\u8ba4\u8bc6\u5c0f\u606a\u54e5\u54e5\u4e86\uff1f\u201d</p><p>\u3000\u3000\u82b7\u5f64\u8fd9\u624d\u8d70\u8fc7\u6765\uff0c\u624b\u62fd\u7740\u5f20\u606a\u7684\u8863\u89d2\uff0c\u53c8\u4e00\u624b\u5c06\u5988\u5988\u7684\u624b\u6307\u7275\u8fc7\u6765\uff0c\u7a1a\u5ae9\u7684\u8138\u4e0a\u5374\u4e0d\u6562\u9732\u51fa\u4e00\u4e1d\u7b11\u5bb9\uff0c\u8ba9\u4eba\u5fc3\u75db\u3002</p><p>\u3000\u3000\u5f20\u606a\u65e0\u6cd5\u660e\u767d\u8f66\u7978\u7ed9\u82b7\u5f64\u8fd9\u4e48\u5c0f\u7684\u5b69\u5b50\u5fc3\u91cc\u7559\u4e0b\u600e\u6837\u7684\u6050\u60e7\uff0c\u7ed9\u5979\u6293\u4f4f\u8863\u89d2\uff0c\u6574\u4e2a\u4e0b\u5348\u5c31\u6ca1\u6709\u677e\u5f00\u624b\uff0c\u8c22\u665a\u6674\u4e5f\u7ed9\u82b7\u5f64\u62fd\u5f97\u7d27\u7d27\u7684\u8131\u4e0d\u5f00\u8eab\u3002</p><p>\u3000\u3000\u62ff\u82b7\u5f64\u6ca1\u6709\u529e\u6cd5\uff0c\u8c22\u665a\u6674\u4e0b\u5348\u4e0e\u8521\u7eef\u5a1f\u8ba8\u8bba\u516c\u53f8\u4e8b\u60c5\u7684\u65f6\u5019\uff0c\u5f20\u606a\u4e5f\u5f97\u4ee5\u5728\u4e00\u65c1\u542c\u7740\u3002</p><p>\u3000\u3000\u8c22\u665a\u6674\u4e0e\u5979\u4e08\u592b\u5f90\u5fd7\u660e\u5728\u7701\u91cc\u521b\u7acb\u6d77\u88d5\u8d38\u6613\u516c\u53f8\u662f\u5728\u5f90\u5b66\u5e73\u8c03\u6765\u505a\u653f\u6cd5\u59d4\u4e66\u8bb0\u4e4b\u524d\uff0c\u8c22\u665a\u6674\u5bb6\u65cf\u5728\u4e1c\u6d77\u7701\u6709\u7740\u5f88\u597d\u7684\u5546\u4e1a\u57fa\u7840\uff0c\u6d77\u88d5\u516c\u53f8\u65e9\u5e74\u4e5f\u53d6\u5f97\u4e00\u4e9b\u6210\u7ee9\uff0c\u5f90\u5b66\u5e73\u8c03\u6765\u505a\u653f\u6cd5\u59d4\u4e66\u8bb0\u4e4b\u540e\uff0c\u5f90\u5fd7\u660e\u5c06\u516c\u53f8\u7684\u4e8b\u52a1\u79fb\u4ea4\u7ed9\u8c22\u665a\u6674\u7684\u5802\u5144\u8c22\u77bb\u7ba1\u7406\uff0c\u516c\u53f8\u7684\u80a1\u4efd\u5168\u90e8\u6302\u5230\u8c22\u665a\u6674\u7684\u540d\u4e0b\uff0c\u7528\u4ee5\u56de\u907f\u5f53\u65f6\u5e72\u90e8\u5b50\u5973\u53ca\u4eb2\u5c5e\u4e0d\u8bb8\u7ecf\u5546\u7684\u653f\u7b56\u3002</p><p>\u3000\u3000\u4ee5\u8f6c\u624b\u8d38\u6613\u4e3a\u4e3b\u8425\u4e1a\u52a1\u7684\u6d77\u88d5\u516c\u53f8\uff0c\u5728\u5168\u7701\u5efa\u7acb\u4e86\u5bc6\u96c6\u7684\u7ecf\u9500\u7f51\u7edc\uff0c\u8fd9\u5728\u4e5d\u5341\u5e74\u4ee3\uff0c\u5728\u73b0\u4ee3\u7269\u6d41\u4f53\u7cfb\u8fd8\u6ca1\u6709\u5b8c\u5168\u5efa\u7acb\u8d77\u6765\u3001\u5382\u5bb6\u5fc5\u987b\u4f9d\u8d56\u4ee3\u7406\u5546\u3001\u4e2d\u95f4\u5546\u5c06\u4ea7\u54c1\u8f93\u9001\u7ec8\u7aef\u5e02\u573a\uff0c\u6d77\u88d5\u516c\u53f8\u5728\u5168\u7701\u5efa\u7acb\u7684\u7ecf\u9500\u7f51\u7edc\u662f\u76f8\u5f53\u91cd\u8981\u7684\u8d44\u6e90\u3002</p><p>\u3000\u3000\u5f53\u7136\uff0c\u7ecf\u9500\u7f51\u7edc\u7684\u5206\u652f\u673a\u6784\u5e9e\u6742\uff0c\u7ba1\u7406\u597d\u8fd9\u4e2a\u7ecf\u9500\u7f51\u7edc\uff0c\u9700\u8981\u76f8\u5f53\u9ad8\u7684\u7ba1\u7406\u6c34\u5e73\u4e0e\u8d22\u52a1\u6c34\u5e73\uff0c\u5f90\u5fd7\u660e\u901a\u8fc7\u8c22\u665a\u6674\u7684\u5802\u5144\u6765\u7ba1\u7406\u516c\u53f8\uff0c\u6d77\u88d5\u516c\u53f8\u5c31\u9646\u9646\u7eed\u7eed\u66b4\u9732\u51fa\u8bb8\u591a\u7ba1\u7406\u4e0a\u7684\u95ee\u9898\u3002</p><p>\u3000\u3000\u5f20\u606a\u542c\u4e86\u4e00\u4e0b\u5348\uff0c\u660e\u767d\u6d77\u88d5\u516c\u53f8\u5728\u7ba1\u7406\u4e0a\u5b58\u5728\u7684\u4e0d\u662f\u4e00\u822c\u6027\u7684\u95ee\u9898\uff0c\u800c\u662f\u4e25\u91cd\u5230\u8981\u5a01\u80c1\u751f\u5b58\u7684\u5927\u95ee\u9898\u3002</p><p>\u3000\u3000\u6bd4\u5982\u8bf4\uff0c\u516c\u53f8\u603b\u90e8\u53ea\u8003\u6838\u4e0b\u9762\u5206\u516c\u53f8\u4e0e\u529e\u4e8b\u5904\u7684\u56de\u6b3e\uff0c\u5bf9\u5f00\u652f\u5374\u6ca1\u6709\u4e25\u683c\u7684\u63a7\u5236\uff0c\u5404\u9879\u8d39\u7528\u62a5\u9500\u90fd\u6ca1\u6709\u7edf\u4e00\u7684\u6807\u51c6\u3002</p><p>\u3000\u3000\u5f20\u606a\u60f3\u8d77\u5927\u5b66\u6bd5\u4e1a\u521a\u5230\u9686\u88d5\u96c6\u56e2\u5de5\u4f5c\u7684\u90a3\u6bb5\u65f6\u95f4\uff0c\u9686\u88d5\u96c6\u56e2\u7684\u8d22\u52a1\u7ba1\u7406\u4e5f\u5f88\u6df7\u4e71\uff0c\u4ed6\u6bcf\u6b21\u51fa\u5dee\u5230\u5916\u5730\uff0c\u9996\u5148\u5c31\u662f\u5230\u8f66\u7ad9\u4e70\u51e0\u5f20\u53d1\u7968\uff0c\u597d\u56de\u53bb\u62a5\u9500\u3002\u9686\u88d5\u96c6\u56e2\u662f\u4ee5\u751f\u4ea7\u4e3a\u4e3b\u7684\u4f01\u4e1a\uff0c\u5076\u5c14\u6709\u51e0\u53ea\u5f20\u606a\u8fd9\u6837\u7684\u86c0\u866b\u8fd8\u57ae\u4e0d\u4e86\uff0c\u6d77\u88d5\u516c\u53f8\u56db\u4e94\u767e\u540d\u5458\u5de5\u5374\u662f\u4ee5\u4e1a\u52a1\u4eba\u5458\u4e3a\u4e3b\uff0c\u8981\u6ca1\u6709\u5f88\u597d\u7684\u8d22\u52a1\u63a7\u5236\u624b\u6bb5\uff0c\u5355\u662f\u8ba9\u4e1a\u52a1\u5458\u4e0d\u505c\u7684\u62b9\u70b9\u5c0f\u6cb9\uff0c\u5c31\u8db3\u8ba9\u6d77\u88d5\u516c\u53f8\u5403\u4e00\u58f6\u7684\u3002</p><p>\u3000\u3000\u5f20\u606a\u6653\u5f97\u81ea\u5df1\u4e3a\u4ec0\u4e48\u6ca1\u6709\u542c\u8bf4\u8fc7\u6d77\u88d5\u516c\u53f8\uff0c\u7ba1\u7406\u8fd9\u4e48\u6df7\u4e71\u7684\u516c\u53f8\uff0c\u5c31\u7b97\u6709\u518d\u5f3a\u7684\u8d44\u6e90\uff0c\u90fd\u4e0d\u53ef\u80fd\u5728\u5927\u8425\u9500\u65f6\u4ee3\u7684\u540e\u671f\u640f\u6740\u4e2d\u751f\u5b58\u4e0b\u6765\u3002</p><p>\u3000\u3000\u5f20\u606a\u4e0e\u5f90\u5fd7\u660e\u5728\u5317\u8857\u5c31\u5306\u5306\u89c1\u8fc7\u4e00\u9762\uff0c\u751a\u81f3\u8fde\u8138\u90fd\u6ca1\u6709\u7ec6\u770b\uff0c\u4f46\u5c31\u8fd9\u7c97\u7c97\u7684\u4e00\u77a5\u5370\u8c61\uff0c\u89c9\u5f97\u5f90\u5fd7\u660e\u8fd8\u50cf\u4e2a\u77e5\u8bc6\u5206\u5b50\uff0c\u5728\u4ed6\u624b\u91cc\uff0c\u6d77\u88d5\u516c\u53f8\u7684\u7ba1\u7406\u4e0d\u5e94\u8be5\u8fd9\u4e48\u5dee\uff0c\u770b\u6765\u8fd8\u662f\u8c22\u665a\u6674\u7684\u90a3\u4e2a\u5802\u5144\u8c22\u77bb\u6709\u95ee\u9898\u3002</p><p>\u3000\u3000\u8fd8\u662f\u4eb2\u621a\uff1f\u4eb2\u621a\u559d\u8d77\u8840\u624d\u8981\u547d\u3002</p><p>\u3000\u3000\u5f90\u5fd7\u660e\u4e0e\u8c22\u665a\u6674\u8fd9\u79cd\u4ece\u9ad8\u77e5\u9ad8\u5e72\u5bb6\u5ead\u51fa\u8eab\u7684\u4eba\uff0c\u770b\u4eba\u7684\u773c\u5149\u4e0d\u4f1a\u592a\u5dee\uff0c\u8c22\u77bb\u771f\u6ca1\u6709\u4e00\u70b9\u7ba1\u7406\u6c34\u5e73\uff0c\u5f90\u5fd7\u660e\u5927\u6982\u4e5f\u4e0d\u4f1a\u5c06\u516c\u53f8\u6258\u7ed9\u4ed6\uff0c\u4f46\u662f\u6d77\u88d5\u516c\u53f8\u76ee\u524d\u7684\u7ba1\u7406\u786e\u5b9e\u5dee\u5f97\u8ba9\u4eba\u65e0\u6cd5\u60f3\u50cf\u3002</p><p>\u3000\u3000\u7ba1\u7406\u6df7\u4e71\uff0c\u4e00\u5bb6\u516c\u53f8\u65e2\u4f7f\u80fd\u52c9\u5f3a\u7ef4\u6301\uff0c\u4e5f\u4e0d\u4f1a\u6709\u4ec0\u4e48\u5229\u6da6\uff0c\u4e0b\u9762\u7684\u5458\u5de5\u5f53\u7136\u4e0d\u4f1a\u6709\u4ec0\u4e48\u597d\u7684\u798f\u5229\uff0c\u4f46\u4e8e\u5bf9\u67d0\u4e9b\u7ba1\u7406\u4eba\u5458\u6765\u8bf4\uff0c\u5374\u662f\u4ece\u4e2d\u5927\u53d1\u6a2a\u8d22\u7684\u673a\u4f1a\u3002</p><p>\u3000\u3000\u6d77\u88d5\u516c\u53f8\u6709\u8fd9\u4e48\u597d\u7684\u8d44\u6e90\uff0c\u7279\u522b\u662f\u5f90\u5fd7\u660e\u80cc\u540e\u7684\u5f90\u5b66\u5e73\uff0c\u81f3\u5c11\u80fd\u8ba9\u6d77\u88d5\u516c\u53f8\u52c9\u5f3a\u7ef4\u6301\uff0c\u53ea\u8981\u7ef4\u6301\u4e00\u5929\uff0c\u8c22\u77bb\u5c31\u80fd\u4ece\u635e\u4e00\u5929\u7684\u94b1\u3002\u5f20\u606a\u7a81\u7136\u89c9\u5f97\u8c22\u665a\u6674\u7684\u8fd9\u4e2a\u5802\u5144\u8fd8\u771f\u4ed6\u5988\u7684\u662f\u4e2a\u4eba\u7269\uff0c\u4f46\u4ece\u8521\u7eef\u5a1f\u4e0e\u8c22\u665a\u6674\u7684\u8ba8\u8bba\u4e2d\uff0c\u5979\u4eec\u4f3c\u4e4e\u6ca1\u6709\u610f\u8bc6\u5230\u8c22\u77bb\u7684\u9669\u6076\u7528\u5fc3\uff0c\u53ea\u662f\u4e0d\u505c\u7684\u62b1\u6028\u8c22\u77bb\u7ba1\u7406\u6c34\u5e73\u4f4e\uff0c\u4e3a\u4eba\u53c8\u521a\u610e\u81ea\u7528\uff0c\u542c\u4e0d\u8fdb\u522b\u4eba\u7684\u610f\u89c1\u3002</p><p>\u3000\u3000\u8521\u7eef\u5a1f\u662f\u5f90\u5fd7\u660e\u7684\u540c\u5b66\uff0c\u7b97\u662f\u6d77\u88d5\u516c\u53f8\u7684\u5143\u8001\uff0c\u5979\u5bf9\u4f01\u4e1a\u7ba1\u7406\u9887\u6709\u89c1\u89e3\uff0c\u9488\u5bf9\u6d77\u88d5\u516c\u53f8\u76ee\u524d\u7684\u95ee\u9898\uff0c\u63d0\u51fa\u597d\u51e0\u70b9\u5efa\u8bae\uff0c\u8ba9\u8c22\u665a\u6674\u50ac\u4fc3\u8c22\u77bb\u53bb\u6267\u884c\u3002</p><p>\u3000\u3000\u5f20\u606a\u542c\u4e86\u5dee\u70b9\u5c31\u7b11\u51fa\u58f0\u6765\uff0c\u5fcd\u4e0d\u4f4f\u8bf4\u9053\uff1a\u201c\u665a\u6674\u59d0\uff0c\u6211\u5012\u89c9\u5f97\u6d77\u88d5\u516c\u53f8\u6700\u5927\u7684\u95ee\u9898\u51fa\u5728\u8fd9\u4e2a\u603b\u7ecf\u7406\u8eab\u4e0a\u3002\u201d</p></article>"}}}]);
